import React, { Component } from "react";
import './About.css'

export default class About extends Component{
    constructor(props) {
        super(props);
        this.state = {
        };
        this.chooseAbout = this.chooseAbout.bind(this)
      }

    chooseAbout(alg) {
        switch (alg) {
            case 1:
                return (
                    `"Backtracking is essentially repeated guessing until you find a solution that works."
                    `
                    )
            
            case 2: 
                return (
                    "Simulated Annealing"
                )

            case 3: 
                return (
                    "Hill Climbing"
                )
            
            default:
                return "Choose an algorithm!"
        }
    }

    render() {
        return (
        <span className='About'>{this.chooseAbout(this.props.selectedAlg)}</span>
        )
    }
}
